import axios from 'axios'

export default class World {
    state = {
	preset: []
    };

    componentDidMount(){
	this.getPreset();
    }

    getPreset() {
	axios
	    .get('http://127.0.0.1:8000/api/worlds/1/')
	    .then(res => {
		this.state.preset = res.data.preset;
		console.log(res.data.preset);
	    }).catch(err => {
		console.log(err);
	    });
    }

}
